(1, '1,4,7', 'Mohajoner Nao ( মহাজনের নাও )', '&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:medium;text-decoration:underline;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;strong&gt;About Subachan&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&lt;br /&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;"&gt;Subachan Nattya Sangsad was established in Dhaka, Bangladesh on January 07, 1977. Subachan is a professional theatre group and an active member of Bangladesh Group Theatre Federation and the Bangladesh Centre of the International Theatre Institute. Subachan is dedicated to the portrayal of the lives and livelihood of the people of Bangladesh, our culture and heritage as south Asian and as Muslim majority nation. We believe that mankind has given birth to the civilization that has been nurtured by the earth and water. Hundreds of years have passed by. We have transformed the globe into an intimate village. Subachan deems this reality as strength of our creative ventures. We commit to project the rites and heritage, livelihood and tradition of human power in our journey of activist performance. Subachan keeps faith in the spirit of humanity and chants: humanity thou supreme, humanity thou subject, humanity thou eternal prospect.&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;text-align:justify;"&gt;Subachan Nattya Sangsad was stablished in Dhaka, Bangladesh on January 07, 1977. Subachan is a professional theatre group and an active member of Bangladesh Group Theatre Federation and the Bangladesh Centre of the International Theatre Institute. Subachan is dedicated to the portrayal of the lives and livelihood of the people of Bangladesh, our culture and heritage as south Asian and as Muslim majority nation. We believe that mankind has given birth to the civilization that has been nurtured by the earth and water. Hundreds of years have passed by. We have transformed the globe into an intimate village. Subachan deems this reality as strength of our creative ventures. We commit to project the rites and heritage, livelihood and tradition of human power in our journey of activist performance. Subachan keeps faith in the spirit of humanity and chants: &lt;/span&gt;&lt;strong style="font-family:Verdana, sans-serif;text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;"&gt;humanity thou supreme, humanity thou subject, humanity thou eternal prospect.&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:''Verdana'',''sans-serif'';"&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-size:medium;line-height:115%;font-family:Tahoma, Geneva, sans-serif;text-decoration:underline;"&gt;&lt;strong&gt;Mohajoner Nao (The boat of infinity)&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:''Verdana'',''sans-serif'';"&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;A part of the spiritual folk singers (baul) compose their songs on physiological thoughts. Their quest is to search the ultimate creator and also to know themselves. Some of them composes music on that and also sings.&amp;nbsp;The baul Shah Abdul karim spent his whole life in reaching the truth about himself and his creator. He also had composed many songs on that thought.&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:''Verdana'',''sans-serif'';"&gt;&amp;nbsp;&lt;br /&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;Karim was born in a remote area of Sunamganj, a district of Bangladesh where the low lands are submerged with water for almost 8 months in a year. Having no institutional education, Karim had experienced the land, the water, the boats, and other components of nature that educated him. In most of his songs, he has compared his body as a boat. Sometimes, he said, that his body is something like a rented boat from his merchant which has to be deposited in course of time. It is his duty to row the boat properly to reach his ultimate goal, to return the boat to his merchant in proper order.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;The play Mohajoner nao, (The boat of infinity) is based on this thought.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', '', 'ewl_2015-06-04-14-38-18.jpg', 'ewb_2015-05-28-17-00-16.jpg', 'eetb_2015-05-28-17-00-16.jpg', 'yes', 100, 'no', 10, 'no', 'no', 'no', 'yes', 'yes', 'no', 'no', '', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Theatre,Shilpakala Academy,মঞ্চ নাটক ', '', 'archived', 1, '2015-04-12 18:13:12', 1, '2015-06-15 06:31:40'),
