(3, '1', 'FIFA World Cup Russia 2018 Qualifiers - Round 2 (Bangladesh VS Kyrgyzstan)', '&lt;p&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;The&amp;nbsp;&lt;/span&gt;&lt;strong&gt;2018 FIFA World Cup qualification&lt;/strong&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;process will decide 31 of the 32 teams which will play in the&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/2018_FIFA_World_Cup" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="2018 FIFA World Cup"&gt;2018 FIFA World Cup&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;, with the hosts&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Russia_national_football_team" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Russia national football team"&gt;Russia&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;qualifying automatically. All 208 remaining FIFA member associations are eligible to enter the&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/FIFA_World_Cup_qualification" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="FIFA World Cup qualification"&gt;qualifying process&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;. For the first time in World Cup history, all national teams registered for the preliminary competition.&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;Not all may compete, as&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Zimbabwe_national_football_team" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Zimbabwe national football team"&gt;Zimbabwe&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;were expelled from the competition on 12 March 2015 due to their failure to pay former coach&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Jos%C3%A9_Claudinei" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Jos&eacute; Claudinei"&gt;Jos&amp;eacute; Claudinei&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;a severance fee,&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;a decision that the&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Zimbabwe_Football_Association" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Zimbabwe Football Association"&gt;Zimbabwe Football Association&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;said they would appeal.&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Bhutan_national_football_team" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Bhutan national football team"&gt;Bhutan&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;have made their FIFA World Cup qualification debut and they will be joined by&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/South_Sudan_national_football_team" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="South Sudan national football team"&gt;South Sudan&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;once that nation plays its first match.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;While the main qualifying draw will take place at the Konstantinovsky Palace in&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Strelna" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Strelna"&gt;Strelna&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Saint_Petersburg" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Saint Petersburg"&gt;Saint Petersburg&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;on 25 July 2015,&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;a number of qualification matches have been played before that.&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;The first began in&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Dili" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Dili"&gt;Dili&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;a class="mw-redirect" href="http://en.wikipedia.org/wiki/Timor-Leste" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Timor-Leste"&gt;Timor-Leste&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;on 12 March as part of the&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/2018_FIFA_World_Cup_qualification_(AFC)" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="2018 FIFA World Cup qualification (AFC)"&gt;AFC&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;''s qualification,&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;with Timorese player&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Chiquito_do_Carmo" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Chiquito do Carmo"&gt;Chiquito do Carmo&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;scoring the first goal of qualification. Matches have also been played in&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/2018_FIFA_World_Cup_qualification_(CONCACAF)" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="2018 FIFA World Cup qualification (CONCACAF)"&gt;CONCACAF&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;prior to the main draw.&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&lt;/span&gt;&lt;/p&gt;', '', 'ewl_2015-06-07-15-42-12.jpg', 'ewb_2015-06-07-15-42-12.jpg', 'eetb_2015-06-07-15-42-12.jpg', 'yes', 500, 'no', 100, 'no', 'no', 'no', 'yes', 'yes', 'no', 'no', '', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Sports,Football,FIFA,World Cup', '', 'archived', 1, '2015-05-07 16:21:40', 10, '2015-06-12 17:20:41'),
