;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;once that nation plays its first match.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;While the main qualifying draw will take place at the Konstantinovsky Palace in&amp;nbsp;&lt;/span&gt;&lt;a en.wikipedia.org="" href="\\" http:="" strelna\\""="" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="\\" wiki=""&gt;Strelna&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;a en.wikipedia.org="" href="\\" http:="" petersburg\\"="" saint"="" saint_petersburg\\""="" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="\\" wiki=""&gt;Saint Petersburg&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;on 25 July 2015,&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;a number of qualification matches have been played before that.&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;The first began in&amp;nbsp;&lt;/span&gt;&lt;a dili\\""="" en.wikipedia.org="" href="\\" http:="" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="\\" wiki=""&gt;Dili&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;a class="\\" en.wikipedia.org="" href="\\" http:="" mw-redirect\\""="" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" timor-leste\\""="" title="\\" wiki=""&gt;Timor-Leste&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;on 12 March as part of the&lt;/span&gt;&lt;a (afc)\\"="" 2018"="" 2018_fifa_world_cup_qualification_(afc)\\""="" cup="" en.wikipedia.org="" fifa="" href="\\" http:="" qualification="" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="\\" wiki="" world=""&gt;AFC&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;\\''s qualification,&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;with Timorese player&amp;nbsp;&lt;/span&gt;&lt;a carmo\\"="" chiquito"="" chiquito_do_carmo\\""="" do="" en.wikipedia.org="" href="\\" http:="" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;backgr