(10, '1', 'FIFA International Friendly Match​ (Bangladesh Vs Singapore)', '&lt;p&gt;A friendly football match between Bangladesh &amp;amp; Singapore on 30th May, 2015 @ Bangabandhu National Stadium, Dhaka.&lt;/p&gt;&lt;p&gt;Your registration confirms your booking for entry to the Match. Ticket delivery shall start from May 27, 2015. You can also collect your ticket from the TicketChai booth in the venue.&lt;/p&gt;', '', 'ewl_2015-05-13-22-09-36.jpg', 'ewb_2015-05-13-19-10-19.jpg', 'eetb_2015-05-13-19-10-19.jpg', 'yes', 298, 'no', 0, 'no', 'no', 'no', 'yes', 'yes', 'yes', 'no', '', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Sports,Football', 'Bangladesh Football Federation', 'archived', 1, '2015-05-13 16:22:03', 1, '2015-05-31 04:15:43'),
(11, '1,5,11', 'FIFA International Friendly Match​ (Bangladesh Vs Afghanistan)', '&lt;p&gt;A friendly football match between Bangladesh &amp;amp; Afghanistan on 02nd June, 2015 @ Bangabandhu National Stadium, Dhaka.&lt;/p&gt;&lt;p&gt;Your registration confirms your booking for entry to the Match. Ticket delivery shall start from May 30, 2015. You can also collect your ticket from the TicketChai booth in the venue.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="color:#0000ff;font-family:verdana, sans-serif;font-size:12.8000001907349px;text-decoration:underline;"&gt;&lt;strong&gt;Your booking confirms your entry to the match. Please collect your ticket from ticketchai booth (at VIP Gate No. 2)&amp;nbsp;in the venue.&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;', '', 'ewl_2015-05-13-22-09-15.jpg', 'ewb_2015-05-13-19-09-55.jpg', 'eetb_2015-05-13-19-09-55.jpg', 'yes', 290, 'no', 0, 'no', 'no', 'no', 'yes', 'yes', 'yes', 'yes', '&lt;p&gt;TicketChai Booth at the Venue.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Sports,Football', 'Bangladesh Football Federation', 'archived', 1, '2015-05-13 16:38:55', 1, '2015-06-04 06:51:09'),
(12, '1,2,3', 'SHREYA GHOSHAL Live in Dhaka', '&lt;p&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:large;line-height:20px;"&gt;&lt;strong&gt;Shreya Ghosal to perform in Dhaka&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-face:Tahoma, Geneva, sans-serif;"&gt;&lt;span style="font-size:14px;line-height:20px;"&gt;Popular Indian playback singer &lt;strong&gt;Shreya Ghosal&lt;/strong&gt; will perform in Bangladesh after five years on June 5, 2015. Bay Entertainment is&amp;nbsp;organizing&amp;nbsp;the concert titled &lt;strong&gt;&amp;ldquo;Shreya Ghoshal&amp;nbsp;Night&amp;rdquo;&lt;/strong&gt;.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-face:Tahoma, Geneva, sans-serif;"&gt;&lt;span style="font-size:14px;line-height:20px;"&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:14px;line-height:20px;"&gt;Another Indian singer &lt;strong&gt;Hrisikesh Pramod Ranade&lt;/strong&gt; will accompany Shreya at the concert.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:14px;line-height:20px;"&gt;The show will held at &lt;strong&gt;Naboratri Hall&lt;/strong&gt; of International Convention City, Bashundhara.&lt;/span&gt;&lt;/p&gt;', '', 'ewl_2015-05-16-02-14-12.jpg', 'ewb_2015-05-16-02-16-22.jpg', 'eetb_2015-05-16-02-14-12.jpg', 'yes', 400, 'no', 0, 'no', 'no', 'no', 'yes', 'yes', 'yes', 'no', '', 'yes', 'yes', '&lt;ol&gt;&lt;li&gt;&lt;span style="font-size:small;line-height:107%;"&gt;The promoter may pros pond, cancel, interrupt or stop the service due to adverse weather, dangerous situation or any other causes which is beyond their control.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style="font-size:small;line-height:107%;"&gt;No exchange of ticket will be made and tickets are not transferable and may not redistributed or used by any commercial marketing event, activity, promotion or purpose without the prior written consent of the organizer.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style="font-size:small;line-height:107%;"&gt;The organizer reserves the right without refund or compensation to refuse admission/evict any person(s) who&amp;rsquo;s conduct is disorderly or inappropriate.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style="font-size:small;line-height:107%;"&gt;No photography, video or audio recording is allowed during shows.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style="font-size:small;line-height:107%;"&gt;The ticket holder will not carry any prohibited items like weapon or drugs dangerous or illegal substances and any kind of recording device.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style="font-size:small;line-height:107%;"&gt;The ticket holders shall abide by the entry conditions, which may found at the venue and other terms and conditions given by the venue.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style="font-size:small;line-height:107%;"&gt;No child below two (2) years of age is allowed inside the show.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style="font-size:small;line-height:107%;"&gt;Above two (2) years old child need a separate ticket for entry.&lt;/span&gt;&lt;/li&gt;&lt;/ol&gt;', 'no', '', 'no', 'no', 'Concert,Music', '&lt;p style="margin-bottom:6px;color:#141823;font-family:helvetica, arial, ''lucida grande'', sans-serif;font-size:14px;line-height:19.3199996948242px;"&gt;&lt;strong&gt;Bay Entertainment PTE Limited&lt;/strong&gt;&lt;/p&gt;&lt;p style="margin-bottom:6px;color:#141823;font-family:helvetica, arial, ''lucida grande'', sans-serif;font-size:14px;line-height:19.3199996948242px;"&gt;&lt;span style="line-height:19.3199996948242px;"&gt;&lt;strong&gt;Facebook:&lt;/strong&gt;&amp;nbsp;https://www.facebook.com/bay.entertainment.pte.ltd&lt;/span&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style="margin-bottom:6px;color:#141823;font-family:helvetica, arial, ''lucida grande'', sans-serif;font-size:14px;line-height:19.3199996948242px;"&gt;&lt;strong&gt;Web:&lt;/strong&gt;&amp;nbsp;http://www.bay-entertainment.com&lt;/p&gt;', 'archived', 1, '2015-05-14 19:57:40', 1, '2015-06-06 06:08:25');
