(13, '4', 'Macbeth (ম্যাকবেথ - পদাতিক নাট্য সংসদ)', '&lt;h4 style="text-align:justify;"&gt;&lt;strong&gt;&lt;span style="font-size:medium;line-height:115%;font-family:Verdana, sans-serif;text-decoration:underline;"&gt;Summary of Macbeth&lt;/span&gt;&lt;/strong&gt;&lt;/h4&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;A thunderstorm and three witches conclude a meeting. They decide to confront the great Scottish general Macbeth on his victorious return from a war between Scotland and Norway. The Scottish king, Duncan, decides that he will confer the title of the traitorous Cawdor on the heroic Macbeth.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Macbeth, and another General called Banquo, happen upon the three witches. The witches predict that he will one day become king. They also predict that Banquo will beget a line of kings, although will not ascend the throne himself. King Duncan arranges to visit him at his castle. Macbeth cannot stop thinking about the witches'' prediction that he will become king and decides that he will murder Duncan. Macbeth''s wife agrees to his plan.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Duncan arrives at the castle with his entourage but he has second thoughts about the murder plot. The forceful Lady Macbeth holds him to his vow to kill Duncan and further encourages him. She then summons evil spirits to "unsex" her and fortify her with cruelty. He then murders Duncan assisted by his wife who smears the blood of Duncan on the daggers of the sleeping guards.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;A nobleman called Macduff discovers the body. Before investigation can take place Macbeth kills the guards insisting that their daggers smeared with Duncan''s blood are proof that they committed the murderous crime. Duncan''s sons, Malcolm and Donalbain, do not believe their father, however, fearing for their lives, they flee Scotland. This makes them appear guilty so the crown passes to Macbeth.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;He remembers the prophecy of the witches that Banquo will beget a line of kings So he sends hired assassins to murder Banquo and his sons Donalbain and Fleance. Fleance, is the only one to escape with his life.&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;At a feast the bloodied ghost of Banquo appears to Macbeth but to no one else causing Macbeth to act and speak strangely. His wife sends the guests away.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Macbeth plagued by the fear of being discovered begins to suspect that Macduff, a nobleman who refused to attend the feast suspects him. He meets with the witches again and they confirm that he has good reason to fear Macduff but they soothe his fears by telling him that no born of woman can harm him.&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;After meeting with the witches he learns that Macduff is urging Duncan''s son, Malcolm, to reclaim the throne. In revenge, he has Macduff''s wife and son murdered. Macduff organizes an army to bring down Macbeth.&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:''Verdana'',''sans-serif'';"&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Lady Macbeth''s conscience now begins to torture her and she imagines that she can see her hands covered with blood. She commits suicide.&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Macbeth meets Macduff in hand-to-hand combat confident that he will win the day because ''''none born of woman'''' can harm him. Macduff then reveals that he was not ''''of woman born'''' but was ''''untimely ripp''d'''' from his mother''s womb. Macduff kills Macbeth and the witches prediction proves true. Malcolm becomes king.&amp;nbsp;The themes discussed are ambition, fate, deception and treachery.&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;"&gt;&lt;strong&gt;&lt;span style="font-size:medium;line-height:115%;font-family:Verdana, sans-serif;text-decoration:underline;"&gt;Performer: on stage&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;DUNCAN : Ashuk kumar Biswas/ Hamidur Rahman Pappu&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;MACOLM : Ikram Sarkar&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;DONALBAIN : Salman Shuvo Chowdhury&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;SERGENT : Jony Khadem&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;ROSS : Sultan Mahmud&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;MACBETH : Shakhawat Hossain Shimul/ Hamidur Rahman Pappu&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;BANQUE : Walid Khan/ Jabed Patwary&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;MACDUFF : Jony Khadem&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;LENNOX : Mohiuddin Jewel&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;LADY MACBETH : Syeeda Shamsi Ara Sayeka/ Jinia Azad&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-size:small;line-height:115%;font-family:Tahoma, Geneva, sans-serif;"&gt;MESSENGER : Mosiur Rahman&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;MURDERER : Gouro Chandra Mondol, Sultan Mahmud&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;SON OF SEWARD : Walid khan/ Jabed Patwary&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:x-small;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;WITCHES : Sayeka,Shimul,Jewel,Jony,Tanmay,Rasel,&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;text-indent:0.5in;"&gt;Joy,Limon&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:x-small;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;Performer : off stage&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:x-small;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;Translation : Syed Shamsul Haq&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:x-small;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;Direction : Sudip Chakroborthy&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:x-small;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;Directorial assistance : Ssanjeeb Kumar Dey&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:x-small;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;Costume design : Wahida Mollick&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:x-small;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;Design assistance : Nila Saha and Syeda Ifat Ara&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:x-small;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:small;font-family:Tahoma, Geneva, sans-serif;"&gt;Music design : Shishir Rahaman&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span style="font-size:x-small;font-family:Tahoma, Geneva, sans-serif;"&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:0.0001pt;"&gt;&lt;span 