(16, '1,2', 'Globe to Globe Hamlet', '&lt;p style="margin-bottom:0pt;"&gt;&lt;strong&gt;&lt;span style="color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:medium;text-decoration:underline;"&gt;HAMLET THE SHOW&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style="margin-bottom:0pt;"&gt;&lt;/p&gt;&lt;p style="text-align:justify;margin-bottom:0pt;"&gt;&lt;span style="color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Learning of his father&amp;rsquo;s death, Prince Hamlet comes home to find his uncle married to his mother and installed on the Danish throne. At night, the ghost of the old king demands that Hamlet avenge his &amp;lsquo;foul and most unnatural murder&amp;rsquo;. &lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;margin-bottom:0pt;"&gt;&lt;span style="color:#333333;font-family:''Times New Roman'',''serif'';font-size:12pt;"&gt;&lt;br /&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Encompassing political intrigue and sexual obsession, philosophical reflection and violent action, Hamlet is Shakespeare&amp;rsquo;s &amp;lsquo;poem unlimited&amp;rsquo;, a colossus in the story of the English language and the fullest expression of his genius.&lt;/span&gt; &lt;/span&gt;&lt;/p&gt;&lt;p style="text-align:justify;margin-bottom:0pt;"&gt;&lt;/p&gt;&lt;p style="margin-bottom:0pt;"&gt;&lt;strong&gt;&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;&lt;p style="margin-bottom:0pt;"&gt;&lt;strong&gt;&lt;span style="color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:12pt;text-decoration:underline;"&gt;Creative Team&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style="margin-bottom:0pt;"&gt;&lt;strong&gt;&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;&lt;p style="margin-bottom:6.25pt;"&gt;&lt;span style="color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;DOMINIC DROMGOOLE, &lt;/span&gt;&lt;strong&gt;DIRECTOR&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:6.25pt;"&gt;&lt;span style="color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;BILL BUCKHURST, &lt;/span&gt;&lt;strong&gt;DIRECTOR&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:6.25pt;"&gt;&lt;span style="color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;JONATHAN FENSOM, &lt;/span&gt;&lt;strong&gt;DESIGNER&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:6.25pt;"&gt;&lt;span style="color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;BILL BARCLAY, &lt;/span&gt;&lt;strong&gt;COMPOSER / MUSIC DIRECTOR&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:6.25pt;"&gt;&lt;span style="color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;LAURA FORREST-HAY, &lt;/span&gt;&lt;strong&gt;ORIGINAL MUSIC&amp;nbsp;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-bottom:6.25pt;"&gt;&lt;span style="color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="line-height:normal;margin-bottom:0pt;"&gt;&lt;strong&gt;&lt;span style="color:#333333;font-family:''Times New Roman'',''serif'';font-size:12pt;"&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style="line-height:normal;margin-bottom:0pt;"&gt;&lt;strong&gt;&lt;span style="color:#333333;font-family:''Times New Roman'',''serif'';font-size:12pt;"&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style="line-height:normal;margin-bottom:0pt;"&gt;&lt;strong&gt;&lt;span style="color:#333333;font-family:''Times New Roman'',''serif'';font-size:12pt;"&gt;About the Project&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style="line-height:normal;margin-bottom:6.25pt;"&gt;&lt;/p&gt;&lt;p style="text-align:justify;line-height:normal;margin-bottom:6.25pt;"&gt;&lt;span style="color:#333333;font-family:''Times New Roman'',''serif'';font-size:12pt;"&gt;The &lt;em&gt;Hamlet &lt;/em&gt;&lt;/span&gt;Globe to Globe tour opened at Shakespeare&amp;rsquo;s Globe on 23 April 2014, the 450th anniversary of Shakespeare&amp;rsquo;s birth. This completely unprecedented theatrical adventure will see&lt;em&gt; Hamlet&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;/em&gt; tour to every single country on earth over 2 years.&amp;nbsp;Sixteen extraordinary men and women are currently travelling across the seven continents, performing in a huge range of unique and atmospheric venues.&lt;/p&gt;&lt;p style="text-align:justify;line-height:normal;margin-bottom:6.25pt;"&gt;&lt;strong&gt;&lt;span style="color:#333333;font-family:''Times New Roman'',''serif'';font-size:12pt;"&gt;Dominic Dromgoole, Artistic Director of Shakespeare&amp;rsquo;s Globe and Director of&amp;nbsp;&lt;em&gt;Hamlet&amp;nbsp;&lt;/em&gt;&lt;/span&gt;&lt;/strong&gt;&lt;em&gt;&lt;br /&gt;&lt;/em&gt;said:&lt;/p&gt;&lt;p style="text-align:justify;line-height:normal;margin-bottom:6.25pt;"&gt;&lt;em&gt;&lt;span style="color:#333333;font-family:''Times New Roman'',''serif'';font-size:12pt;"&gt;&amp;lsquo;Globe to Globe&amp;nbsp;&lt;/span&gt;&lt;/em&gt;&lt;span style="color:#333333;font-family:''Times New Roman'',''serif'';font-size:12pt;"&gt;Hamlet&lt;em&gt;&amp;nbsp;was created with the aim of performing Hamlet to as many&amp;nbsp;people as possible, in as diverse a range of places as possible. The central principle of the&amp;nbsp;tour is that Shakespeare can entertain and speak to anyone, no matter where they are on&amp;nbsp;earth; and that no country or people are not better off for the lively presence of&amp;nbsp;Hamlet&lt;em&gt;.&amp;rsquo;&lt;/em&gt;&lt;/em&gt;&lt;/span&gt;&lt;/p&gt;&lt;br /&gt;', '', 'ewl_2015-06-07-15-50-33.png', 'ewb_2015-06-08-20-17-08.jpg', 'eetb_2015-06-08-20-17-09.jpg', 'yes', 600, 'no', 0, 'no', 'no', 'yes', 'no', 'yes', 'yes', 'no', '', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Theatre,Shakespeare,Director Dominic Dromgoole', '&lt;p&gt;&lt;span style="line-height:115%;font-family:''Times New Roman'',''serif'';font-size:12pt;"&gt;&lt;span style="font-family:Verdana,Geneva,sans-serif;font-size:small;"&gt;Event Name: Hamlet by Shakespeare&amp;rsquo;s Globe&lt;/span&gt;&lt;span&gt;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="line-height:115%;font-family:Verdana,Geneva,sans-serif;font-size:small;"&gt;Project Name: &lt;/span&gt;&lt;span style="font-family:Verdana,Geneva,sans-serif;font-size:small;"&gt;Globe to Globe Hamlet&lt;/span&gt;&lt;span&gt;&amp;nbsp; &lt;/span&gt;&lt;span style="font-family:Verdana,Geneva,sans-serif;font-size:small;"&gt;by Shakespeare&amp;rsquo;s Globe&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-family:Verdana,Geneva,sans-serif;font-size:small;"&gt;Performed by: Shakespeare&amp;rsquo;s Globe, 21 New Globe Walk, Bankside, London SE1 9DT&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-family:Verdana,Geneva,sans-serif;font-size:small;"&gt;Web: &lt;/span&gt;&lt;a href="http://globetoglobe.shakespearesglobe.com/hamlet/about-the-project"&gt;&lt;span style="font-family:Verdana,Geneva,sans-serif;font-size:small;"&gt;http://globetoglobe.shakespearesglobe.com/hamlet/about-the-project&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-family:Verdana,Geneva,sans-serif;font-size:small;"&gt;Venue: Bangladesh Shilpakala Academy&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="font-family:Verdana,Geneva,sans-serif;font-size:small;"&gt;Time: July 15, 2015 7.00 PM&lt;/span&gt;&lt;/p&gt;&lt;br /&gt;', 'archived', 1, '2015-06-07 15:50:33', 1, '2015-08-05 04:52:39'),
(17, '1,2', 'BD HIP HOP FEST 2015', '&lt;p&gt;&lt;span class="fsl"&gt;Introducing (finally) for the 1st time, a platform that all of the talent our beautiful country possesses, putting emphasis on hip hoppers from every corner of the country under one roof, which these artist can be proud of. A full day and night full of live musical performance, international fashion show featuring renown models from all over the world, socializing with classy individuals, plus so much more surprises that we feel obliged not to share at this moment so you all could have your mind blown, all-in-all a revolutionary entertainment segment, that is surely one that you would regret missing out on.&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span class="fsl"&gt;Musical Performers (Alphabetically Ordered):-&lt;br /&gt;&lt;br /&gt;A Khan (The Stunnerz)&lt;br /&gt;Aisha &lt;br /&gt;Bangla Mentalz&lt;br /&gt;Bishal Karim&lt;br /&gt;&lt;span class="text_exposed_show"&gt;CDL (with Rafsan &amp;amp; Rho)&lt;br /&gt;Clonz Empire&lt;br /&gt;CT Unit&lt;br /&gt;Dave Browne&lt;br /&gt;D-HAZ&lt;br /&gt;Different&lt;br /&gt;Dorpon RVS&lt;br /&gt;Green Alert&lt;br /&gt;Green Coast&lt;br /&gt;Irfu &amp;amp; Sants&lt;br /&gt;Jalali Set&lt;br /&gt;Mahi Hasin&lt;br /&gt;Mobster Records&lt;br /&gt;Nirzhor&lt;br /&gt;NGS Terrors&lt;br /&gt;Ovijaan&lt;br /&gt;Rajotto&lt;br /&gt;Rakzo&lt;br /&gt;Rap Soul&lt;br /&gt;Rhyming Analysis&lt;br /&gt;Royal Bengal Mob&lt;br /&gt;Run BHG&lt;br /&gt;Sha-T&lt;br /&gt;Smoke Show&lt;br /&gt;Uptown Lokolz&lt;br /&gt;Voice Of the Voiceless&lt;br /&gt;Xefer Rahman&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;DJ: Ziko Paul&lt;br /&gt;&lt;br /&gt;SPECIAL APPEARANCE &lt;br /&gt;Shahan AHM&lt;br /&gt;&lt;br /&gt;Dancers:-&lt;br /&gt;&lt;br /&gt;Anonymous Crew&lt;br /&gt;B-Bots&lt;br /&gt;Blue Poppers&lt;br /&gt;Naur (Fire Spinning Crew)&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;Beatboxers:-&lt;br /&gt;&lt;br /&gt;Akash&lt;br /&gt;Arghya Mandal&lt;br /&gt;Beatboxer Shohan&lt;br /&gt;Kabbya&lt;br /&gt;Ronesh Biswas&lt;br /&gt;Sabbir Al Kabbo&lt;br /&gt;Sean Shizzy&lt;br /&gt;T-Rex&lt;br /&gt;Wasiu&lt;br /&gt;ZDE&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;Graffiti Artist:-&lt;br /&gt;Renegade.&lt;/span&gt;&lt;/span&gt;&lt;span class="fsl"&gt;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;', '', 'ewl_2015-07-21-17-39-04.jpg', 'ewb_2015-07-21-19-22-11.jpg', 'eetb_2015-07-21-17-39-04.jpg', 'yes', 1000, 'no', 0, 'no', 'no', 'no', 'yes', 'yes', 'yes', 'no', '', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Music,Fest Event', '&lt;span class="fsl"&gt;&lt;span class="text_exposed_show"&gt;An event by Rendezvous Pvt. LTD.&lt;br /&gt;&lt;br /&gt;For further details call:-&lt;br /&gt;01674387792&lt;br /&gt;01677235152.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;/span&gt;&lt;/span&gt;', 'archived', 1, '2015-07-21 17:39:05', 1, '2015-08-01 06:53:55'),
(18, '1,4,7', 'Rabindranath Tagore''s `CHITRANGADA'' ', '&lt;p&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;38th Show of Swapnadal Production Rabindranath Tagore''s `CHITRANGADA'' (''চিত্রাঙ্গদা'', Poetic Drama Version by Tagore in 1892, Direction: Zahid Repon):&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;Date: 30th July 2015 (Thursday), Time: 7:00 pm, Venue: Studio Theatre Hall, Bangladesh Shilpakala Academy (National Academy of Fine &amp;amp; Performing Arts), Segunbagicha, Dhaka, Bangladesh.&lt;br /&gt;&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;This is a must to watch production and all of you are cordially invited!&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;For Advance Booking: +88 01912 022152&amp;nbsp;&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;(BDT 200/=, 100/= &amp;amp; 50/=. Limited seats)&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;Details of the Swapnadal Production Poetic Drama (Kabyanatya)`CHITRANGADA'' (''চিত্রাঙ্গদা'')&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;`CHITRANGADA'' is the 11th production of Swapnadal, written by Nobel Laureate Rabindranath Tagore and directed by Zahid Repon.&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;', '', 'ewl_2015-07-24-20-33-12.jpg', 'ewb_2015-07-24-20-33-13.jpg', 'eetb_2015-07-24-20-33-13.jpg', 'yes', 500, 'no', 0, 'no', 'no', 'no', 'yes', 'yes', 'yes', 'no', '', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Theatre,Shilpakala Academy,মঞ্চ নাটক ', '&lt;a href="https://www.facebook.com/groups/swapnadal/" style="color:#4e5665;cursor:pointer;text-decoration:none;position:relative;z-index:2;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;white-space:nowrap;"&gt;SWAPNADAL (Dreamteam)&lt;/a&gt;', 'archived', 1, '2015-07-24 20:33:13', 1, '2015-08-01 06:54:00'),
(19, '1,2', 'Get Amped Series Presents : THE FUTURE IS NOW', '&lt;p&gt;GET AMPED SERIES PRESENTS : &amp;nbsp;&lt;strong&gt;::: THE FUTURE IS NOW :::&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Get Amped Series brought you the first ever underground concert in Uttara. Maintaining the quality in music has always been the first priority of Get Amped Series since its establishment.&lt;/p&gt;&lt;p&gt;The Get Amped Series exists to organize concerts, music festivals, battle of the bands, tribute gigs in Bangladesh . Our team also works to create greater opportunities for the young musicians to participate and promote their creative skills along with the experienced bands of the country. At the same time, we search for the new talents to reveal their creativity. In addition to all other activities, maintaining the quality in music has always been the first priority of Get Amped Series since its establishment.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Band&amp;nbsp; LINE UP&lt;/strong&gt; : &lt;br /&gt;ARBOVIRUS &lt;/p&gt;&lt;p&gt;CHRONIC XORN (INDIA , KOLKATA)&lt;/p&gt;&lt;p&gt;SENT MEN REVOLT &lt;/p&gt;&lt;p&gt;&amp;nbsp;REBORN &amp;nbsp;&lt;/p&gt;&lt;p&gt;MECHANIX&lt;/p&gt;&lt;p&gt;PORAHO &lt;/p&gt;&lt;p&gt;OWNED &lt;/p&gt;&lt;p&gt;TRAINWRECK&lt;/p&gt;&lt;p&gt;CONCLUSION &lt;/p&gt;&lt;p&gt;ABSENTIA &lt;/p&gt;&lt;p&gt;&amp;nbsp;DISTORTED &lt;/p&gt;&lt;p&gt;STEREO TRIM &lt;/p&gt;&lt;p&gt;ALTERNATE ILLUSION &lt;/p&gt;&lt;p&gt;&amp;nbsp;ALERION&lt;/p&gt;&lt;p&gt;*SOUND SUPPORTED BY : &lt;strong&gt;SCREAM&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;*NO MORE BANDS WILL BE ADDED , PLEASE DO NOT CALL FOR SLOTS !&lt;/p&gt;', '', 'ewl_2015-07-28-12-55-46.jpg', 'ewb_2015-07-28-12-55-46.jpg', 'eetb_2015-07-28-12-55-46.jpg', 'yes', 200, 'no', 0, 'no', 'no', 'no', 'yes', 'yes', 'yes', 'yes', '&lt;ul class="list-unstyled footer-list" style="box-sizing:border-box;margin-top:0px;margin-bottom:10px;padding-left:0px;list-style:none;color:#212121;font-family:Roboto, ''Helvetica Neue'', Helvetica, Arial, sans-serif;font-size:14px;line-height:22px;"&gt;&lt;li style="box-sizing:border-box;"&gt;&lt;span style="box-sizing:border-box;"&gt;Razzak Plaza (8th Floor),1 New Eskaton Road, Moghbazar Circle, Dhaka-1217&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;&lt;li style="box-sizing:border-box;"&gt;&amp;nbsp;&lt;span style="box-sizing:border-box;"&gt;+880-1971-842538&lt;/span&gt;,&lt;span style="box-sizing:border-box;"&gt;+880-447-8009569&lt;/span&gt;&lt;/li&gt;&lt;li style="box-sizing:border-box;"&gt;&amp;nbsp;&lt;a href="http://ticketchai.com/www.ticketchai.com" style="box-sizing:border-box;color:#333333;text-decoration:none;outline:0px;transition:all 0.2s linear 0s, letter-spacing 0s linear 0s;background-color:transparent;"&gt;Website: www.ticketchai.com&lt;/a&gt;&lt;/li&gt;', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Concert,Music', 'Get Amped Series', 'archived', 1, '2015-07-28 12:55:47', 1, '2015-08-08 04:19:10'),
(20, '1', 'Naveed’s Comedy Show', '&lt;p&gt;&amp;nbsp;Naveed''s Comedy Show&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;Naveed&amp;rsquo;s Comedy Club comes to Dhanmondi with its stand-up comedy performance at Alliance Francaise de Dhaka, Dhanmondi on August 12 at 7pm. &lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;Naveed Mahbub and Ahmad Ashik, both leading stand-up comedians in Bangladesh, are all set to rock the stage in Dhanmondi.&lt;/p&gt;&lt;p&gt;The show will be in Bangla and is suitable for all ages.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;Tickets are priced at Tk. 300&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;Naveed Mahbub was the Best Male Comedian at the 2007 Original Las Vegas Comedy Festival in the US. He has performed in the US, UK, Spain, India, Myanmar,&lt;/p&gt;&lt;p&gt;Indonesian and of course, Bangladesh. He performs in Bangla as well as in English. &lt;/p&gt;&lt;p&gt;He is the host of the popular show on NTV, The Naveed Mahbub Show. He is the founder &lt;/p&gt;&lt;p&gt;of Naveed&amp;rsquo;s Comedy Club, Bangladesh&amp;rsquo;s first stand-up comedy venue. Naveed has appeared on &lt;/p&gt;&lt;p&gt;just about all the TV and radio channels in Bangladesh.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;Ahmad Ashik is a barrister and a highly popular comedian. He started his comedy career &lt;/p&gt;&lt;p&gt;when he was at United Kingdom. He also performed comedy in Singapore. He is a regular at &lt;/p&gt;&lt;p&gt;Naveed&amp;rsquo;s Comedy Club and has also appeared on several TV and Radio channels.&lt;/p&gt;', '', 'ewl_2015-08-03-14-35-31.jpg', 'ewb_2015-08-03-14-35-31.jpg', 'eetb_2015-08-03-14-35-31.jpg', 'yes', 0, 'no', 0, 'no', 'no', 'yes', 'no', 'yes', 'yes', 'yes', '&lt;p&gt;Pick Point Address&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;Ticket Chai Limited&lt;/p&gt;&lt;p&gt;Razzak Plaza (8th floor), 1 New Eskaton Road, Moghbazar Circle, Dhaka -1217.&lt;/p&gt;', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Comedy Show', '&lt;p&gt;Naveed''s Comedy Club&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', 'active', 13, '2015-08-03 12:40:43', 13, '2015-08-03 08:35:31'),
