(27, '1', ' Science Fiction Convention_Dhaka_2015', '&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;Sci-Fi Con (Science-Fiction Convention) is an exciting fun event (organized by Fun Factory Rides) for fans of Science fiction, fantasy &amp;amp; mecha-lovers to gather around, take photos in different enjoyable attractive booths and generally just have a REAL good time with people having similar interes&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;BROADly&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;For the FIRST time in Bangladesh, we are bringing out an awe-striking maze for people to enter the multidimensional hall of wonder, where the surrounding of the place will move each person in the hall. This special event is been organized by ''Fun Factory Rides'', a professional and passionate thematic party planner and event organizing firm.&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;There have been many cons in Dhaka. So we wanted to bring&lt;br /&gt;&lt;/span&gt;&lt;span class="text_exposed_show" style="display:inline;color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;&amp;nbsp;something NEW that is exciting, understandable and familiar to the overall economy (i.e. adults, teens and kids) of international culture....A SCIENCE FICTION CONVENTION!&lt;br /&gt;&lt;br /&gt;SPECIAL ATTRACTION (in REAL size):&lt;br /&gt;&lt;br /&gt;-BATPOD model&lt;br /&gt;-Baymax&lt;br /&gt;-Wall-E&lt;br /&gt;-DANBO Mascot&lt;br /&gt;-Space Shuttle&lt;br /&gt;-E.T.&lt;br /&gt;-The Thing (F4)&lt;br /&gt;-LED Infinity Mirror&lt;br /&gt;-3D wall and floor art&lt;br /&gt;-30 Thematic Corners of well-known movies and scientists ETC.&lt;br /&gt;COSPLAY:&lt;br /&gt;-Any characters from the Science Fiction movies, TV series, comics, anime etc. will be prioritized. However, non-sci-fi characters are equally welcomed.&lt;br /&gt;-Participants needs to:&lt;br /&gt;*Get your picture taken by our event photographer&lt;br /&gt;*Post your own cosplay pic in our event page&lt;br /&gt;-Winners would be selected on: awaken the character in self (20%), costume perfection (40%) &amp;amp; craftsmanship (40%)&lt;br /&gt;&lt;br /&gt;-PRIZES: Both Male &amp;amp; Female:&lt;br /&gt;1st, 2nd, 3rd, 4th &amp;amp; 5th Prize: 15000, 12000, 10000, 8000 &amp;amp; 5000 BDT&lt;br /&gt;PRIZES: Kids:&lt;br /&gt;1st, 2nd &amp;amp; 3rd Prize: 2000 BDT gift voucher each&lt;br /&gt;COSPLAY REGISTRATION:&lt;br /&gt;- Fill up this excel after downloading from&amp;nbsp;&lt;a href="https://www.sendspace.com/file/e52rbu" rel="nofollow nofollow" style="color:#3b5998;cursor:pointer;text-decoration:none;" target="_blank"&gt;https://www.sendspace.com/&lt;/a&gt;&lt;/span&gt;&lt;a href="https://www.sendspace.com/file/e52rbu" rel="nofollow nofollow" style="color:#3b5998;cursor:pointer;text-decoration:none;" target="_blank"&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;/a&gt;&lt;wbr&gt;&lt;/wbr&gt;&lt;span class="word_break" style="display:inline-block;"&gt;&lt;/span&gt;file/e52rbu&amp;nbsp;&amp;amp; email to "inbox.convention@gmail.co&lt;wbr&gt;&lt;/wbr&gt;&lt;span class="word_break" style="display:inline-block;"&gt;&lt;/span&gt;m" along with your photo!&lt;br /&gt;&lt;br /&gt;PASSES &amp;amp; PRICE:&lt;br /&gt;- Tickets would be available on the event spot&lt;br /&gt;- Ticket Price: 500 BDT&lt;br /&gt;- Ticket Price: 200 BDT (For Cosplayers)&lt;br /&gt;&lt;br /&gt;VENUE:&lt;br /&gt;Emmanuelle&amp;rsquo;s Banquet Hall&lt;br /&gt;Road- 134 (Road behind ALMAS SUPER SHOP), House- 2, Gulshan-1, Dhaka-1212&lt;br /&gt;&lt;br /&gt;TIME:&lt;br /&gt;SEP 3rd,2015: 1 pm-9 pm&lt;br /&gt;SEP 4th &amp;amp; 5th,2015: 10 am-9 pm&lt;br /&gt;&lt;br /&gt;RULES &amp;amp; REGULATIONS:&lt;br /&gt;&lt;br /&gt;-NO SMOKING!!&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;', '', 'ewl_2015-08-08-16-38-51.jpg', 'ewb_2015-08-08-16-38-52.jpg', 'eetb_2015-08-08-16-38-52.jpg', 'yes', 500, 'no', 0, 'no', 'no', 'no', 'yes', 'yes', 'yes', 'yes', '&lt;ul class="list-unstyled footer-list" style="box-sizing:border-box;margin-top:0px;margin-bottom:10px;padding-left:0px;list-style:none;color:#212121;font-family:Roboto, ''Helvetica Neue'', Helvetica, Arial, sans-serif;font-size:14px;line-height:22px;"&gt;&lt;li style="box-sizing:border-box;"&gt;&amp;nbsp;Ticket Chai Limited&lt;/li&gt;&lt;li style="box-sizing:border-box;"&gt;&lt;span style="box-sizing:border-box;"&gt;Razzak Plaza (8th Floor),1 New Eskaton Road,&lt;/span&gt;&lt;/li&gt;&lt;li style="box-sizing:border-box;"&gt;&lt;span style="box-sizing:border-box;"&gt;Moghbazar Circle, Dhaka-1217&lt;/span&gt;&lt;/li&gt;&lt;li style="box-sizing:border-box;"&gt;&lt;span style="box-sizing:border-box;"&gt;Hot Line:&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Verdana, Geneva, sans-serif;font-size:12px;box-sizing:border-box;"&gt;+880-1971-842538&lt;/span&gt;&lt;span style="font-family:Verdana, Geneva, sans-serif;font-size:12px;"&gt;,&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;', 'yes', 'yes', '&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-NO SMOKING!!&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-Respect one another. No pushing! No Critics!&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-Cooperate with Fun Factory Rides and Sci-Fi Con event staff and volunteer partners&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-Violence, verbal abuse or any sort of sexual harassment is extremely prohibited&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-Those who are cosplaying, please maintain safety precautions in handing your Cosplay props &amp;amp; ask the volunteers for help of any sort&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-Take cosplayers permission before taking photos with them&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-Do not cause any harm to the venue, equipment &amp;amp; absolutely NO trashing&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-During any sort of display and announcement in the 3D Projection Map, please remain silent&lt;br /&gt;&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-No foods are allowed downstairs (display setting) as food station is upstairs&lt;br /&gt;&lt;/span&gt;&lt;br style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;" /&gt;&lt;span style="color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:18.7600002288818px;"&gt;-Respect FUN FACTORY RIDES''s organizers and their decisions in choosing the Cosplay winners&lt;br /&gt;&lt;/span&gt;', 'no', '', 'no', 'no', 'Fest Event', '&lt;span style="color:#4e5665;font-face:helvetica, arial, sans-serif;"&gt;&lt;span style="font-size:14px;line-height:18.7600002288818px;white-space:nowrap;"&gt;Fun Factory Rides&lt;/span&gt;&lt;/span&gt;', 'active', 1, '2015-08-08 14:30:23', 1, '2015-08-08 12:26:41'),
(28, '1,4', 'Selim Al Deen Jonmotshob 2015', '&lt;p style="color:#222222;font-family:verdana, sans-serif;font-size:12.8000001907349px;"&gt;An unparalleled playwright in the post Tagore era in Bangla literature, Selim Al Deen developed a &amp;lsquo;new drama form&amp;rsquo; based on the traditional narratives.&lt;/p&gt;&lt;p style="color:#222222;font-family:verdana, sans-serif;font-size:12.8000001907349px;"&gt;He was a theoretician of drama, a scholar, an organiser and a professor of drama and dramatics department at Jahangirnagar University.&lt;/p&gt;&lt;p style="color:#222222;font-family:verdana, sans-serif;font-size:12.8000001907349px;"&gt;His narratives are lyrical and nature appears spontaneously in his plays. The structure of his plays is also innovative as the trendsetter playwright and theoretician negated the conventional concept of theatre labeling it western and initiated to develop a different theatre form based on the tradition of hundreds of years.&lt;/p&gt;&lt;p style="color:#222222;font-family:verdana, sans-serif;font-size:12.8000001907349px;"&gt;He has also successfully executed his theory in his popular plays such as Shakuntala, Kittonkhola, Keramat Mongol, Hat Hadai, Chaka, Joiboti Koinnar Mon, Horgoj, Bonopangshul, Nimojjon and Dhaboman.&lt;/p&gt;', '', 'ewl_2015-08-11-13-54-57.jpg', 'ewb_2015-08-11-13-54-58.jpg', 'eetb_2015-08-11-13-54-58.jpg', 'yes', 550, 'no', 0, 'no', 'no', 'no', 'yes', 'yes', 'yes', 'no', '', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Theatre,Shilpakala Academy', '&lt;div class="gmail_default" dir="ltr" style="color:#222222;font-size:12.8000001907349px;font-family:verdana, sans-serif;"&gt;Dhaka Theatre&lt;/div&gt;&lt;div class="gmail_default" style="color:#222222;font-size:12.8000001907349px;font-family:verdana, sans-serif;"&gt;&lt;/div&gt;&lt;div class="gmail_default" dir="ltr" style="color:#222222;font-size:12.8000001907349px;font-family:verdana, sans-serif;"&gt;Bangladesh Gram Theatre&lt;/div&gt;&lt;div class="gmail_default" style="color:#222222;font-size:12.8000001907349px;font-family:verdana, sans-serif;"&gt;&lt;/div&gt;&lt;div class="gmail_default" dir="ltr" style="color:#222222;font-size:12.8000001907349px;font-family:verdana, sans-serif;"&gt;Selim Al Deen Foundation&lt;/div&gt;', 'active', 1, '2015-08-11 13:54:59', 1, '2015-08-11 10:33:56'),
(29, '1,4', 'NEELAKHYAN, a Mohakal''s New Production', '&lt;p style="margin-bottom:6px;color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:19.3199996948242px;"&gt;Mohakal''s production-36&lt;br /&gt;A lyrical dramatization of national poet Kani Nazrul Islam&amp;rsquo;s story &amp;lsquo;Shapude&amp;rsquo;&lt;br /&gt;NEELAKHYAN&lt;br /&gt;Script- Anan Zaman&lt;br /&gt;Direction- Yusuf Hassan Arko&lt;br /&gt;&lt;/p&gt;&lt;div class="text_exposed_show" style="display:inline;color:#141823;font-family:helvetica, arial, sans-serif;font-size:14px;line-height:19.3199996948242px;"&gt;&lt;p style="margin-bottom:6px;"&gt;Friday, August 14 at 7:00pm&lt;/p&gt;&lt;/div&gt;&lt;p&gt;&lt;/p&gt;&lt;p style="margin-top:6px;margin-bottom:6px;"&gt;Experimental Theater Hall, Bangladesh Shilpakal Academy, Segunbagicha, Dhaka&lt;/p&gt;&lt;p style="margin-top:6px;margin-bottom:6px;"&gt;All are cordially invited&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', '', 'ewl_2015-08-11-19-55-30.jpg', 'ewb_2015-08-12-10-09-55.jpg', 'eetb_2015-08-11-19-55-37.jpg', 'yes', 560, 'no', 0, 'no', 'no', 'no', 'yes', 'yes', 'no', 'yes', '&lt;ul class="list-unstyled footer-list" style="box-sizing:border-box;margin-top:0px;margin-bottom:10px;padding-left:0px;list-style:none;color:#212121;font-family:Roboto, ''Helvetica Neue'', Helvetica, Arial, sans-serif;font-size:14px;line-height:22px;"&gt;&lt;li style="box-sizing:border-box;"&gt;&lt;span style="box-sizing:border-box;"&gt;Razzak Plaza (8th Floor),1 New Eskaton Road, Moghbazar Circle, Dhaka-1217&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;&lt;li style="box-sizing:border-box;"&gt;&amp;nbsp;&lt;span style="box-sizing:border-box;"&gt;+880-1971-842538&lt;/span&gt;&lt;/li&gt;', 'yes', 'yes', '', 'no', '', 'no', 'no', 'Theatre,Shilpakala Academy,মঞ্চ নাটক ', '&lt;a href="https://www.facebook.com/Mohakalgrouptheatrebd" style="color:#3b5998;cursor:pointer;text-decoration:none;font-family:helvetica, arial, sans-serif;line-height:16.0799999237061px;white-space:nowrap