INSERT INTO `event_participants` (`EP_id`, `EP_event_id`, `EP_participant_name`, `EP_current_position`, `EP_details`, `EP_image`, `EP_created_on`, `EP_created_by`, `EP_updated_on`, `EP_updated_by`) VALUES
(1, 5, 'Mika Singh', 'Singer, composer, performer & songwriter', '&lt;strong&gt;Mika Singh&lt;/strong&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;is a singer, composer, performer, songwriter. Amongst a wide catalogue of songs, the prominent ones are "Bas Ek King" (&lt;/span&gt;&lt;em&gt;Singh Is Kinng&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), "Mauja Hi Mauja" (&lt;/span&gt;&lt;em&gt;Jab We Met&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), "Ibn-e-Batuta" (&lt;/span&gt;&lt;em&gt;Ishqiya&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), "Dhanno" (&lt;/span&gt;&lt;em&gt;Houseful&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), "Dhinka Chika" (&lt;/span&gt;&lt;em&gt;Ready&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), "Desi Beat" (&lt;/span&gt;&lt;em&gt;Body Guard&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), "Subah Hone Na De" (&lt;/span&gt;&lt;em&gt;Desi Boys&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), "Pungi" (&lt;/span&gt;&lt;em&gt;Agent Vinod&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), "Ganpat" (&lt;/span&gt;&lt;em&gt;Shootout at Lokhandwala&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), Gabru (album), "chinta ta ta chita chita" (&lt;/span&gt;&lt;em&gt;Rowdy Rathore&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;), "Main tere agal bagal hun" (&lt;/span&gt;&lt;em&gt;Phata Poster Nikla Hero&lt;/em&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;) and Sawan Mein Lag Haye Aag (album), to name a few. He is also known for the "Jaatan (&lt;/span&gt;&lt;a class="mw-redirect" href="http://en.wikipedia.org/wiki/Jat" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Jat"&gt;Jat&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;) ka chora" song, which is based on the&amp;nbsp;&lt;/span&gt;&lt;a class="mw-redirect" href="http://en.wikipedia.org/wiki/Jat" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Jat"&gt;Jat&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;clan (&lt;/span&gt;&lt;a class="mw-redirect" href="http://en.wikipedia.org/wiki/Punjab" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Punjab"&gt;Punjab&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;and&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Haryana" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Haryana"&gt;Haryana&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;) Rani tu mi Raja&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Son_of_Sardaar" style="text-decoration:none;color:#0b0080;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Son of Sardaar"&gt;Son of Sardaar&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;.&lt;/span&gt;', 'guest_2015-05-09-02-43-44_eid_5.jpg', '2015-05-09 02:43:44', 1, '2015-05-08 20:43:44', 0),
(2, 12, 'Shreya Ghoshal', 'Playback Singer', '&lt;strong&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Shreya Ghoshal&lt;/span&gt;&lt;/strong&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;&amp;nbsp;(শ্রেয়া ঘোষাল, born 12 March 1984) is an&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Indian&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;playback singer&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;&amp;nbsp;who mainly sings in&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Hindi&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Nepali&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Bengali&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Kannada&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;,&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Malayalam&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Tamil&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;&amp;nbsp;and&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Telugu&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;&amp;nbsp;films as well as in other Indian languages such as&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Assamese&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Gujarati&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Marathi&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Oriya&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;, and&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Punjabi&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;. She has received numerous&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;awards and nominations&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;, including four&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;National Film Awards&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;&amp;nbsp;for best playback singer, three State Film Awards, five&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Filmfare Awards&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;&amp;nbsp;(four for best playback singer), and seven&amp;nbsp;&lt;/span&gt;&lt;span style="font-family:Tahoma, Geneva, sans-serif;font-size:small;"&gt;Filmfare Awards South&lt;/span&gt;&lt;span style="color:#252525;font-family:Tahoma, Geneva, sans-serif;font-size:small;line-height:22.3999996185303px;"&gt;. She has established herself as a leading female playback singer in Indian cinema.&lt;/span&gt;', 'guest_2015-05-14-20-15-13_eid_12.png', '2015-05-14 20:15:14', 1, '2015-05-14 14:15:14', 0),
(3, 12, 'Hrishikesh Ranade', 'Playback Singer', '&lt;strong&gt;Hrishikesh Ranade&lt;/strong&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;is an Indian playback singer in Marathi film industry. He has sung songs in&amp;nbsp;&lt;/span&gt;Hindi&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;Marathi&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;and in some other Indian languages. He won Idea Sa Re Ga Ma Pa Maharashtracha Ajacha Awaaj.&lt;/span&gt;', 'guest_2015-05-14-20-20-01_eid_12.jpg', '2015-05-14 20:20:01', 1, '2015-05-14 14:20:01', 0);
