(6, 11, 'Bangabandhu National Stadium', '&lt;strong&gt;Bangabandhu National Stadium&lt;/strong&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;, (&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Bengali_language" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Bengali language"&gt;Bengali&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;:&amp;nbsp;&lt;/span&gt;&lt;span lang="bn" style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;" xml:lang="bn"&gt;বঙ্গবন্ধু জাতীয় স্টেডিয়াম&lt;/span&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;) also known as&amp;nbsp;&lt;/span&gt;&lt;strong&gt;Dhaka Stadium&lt;/strong&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;, and formerly known as&amp;nbsp;&lt;/span&gt;&lt;strong&gt;Dacca Stadium&lt;/strong&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;is the national stadium and a multipurpose sports arena in&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Dhaka" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Dhaka"&gt;Dhaka&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;,&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Bangladesh" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Bangladesh"&gt;Bangladesh&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;. It is located in the&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/Motijheel" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="Motijheel"&gt;Motijheel&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;&amp;nbsp;area in the heart of the city. The Stadium have been renovated quite a few times, recently it was renovated during the&amp;nbsp;&lt;/span&gt;&lt;a href="http://en.wikipedia.org/wiki/2011_Cricket_World_Cup" style="color:#0b0080;text-decoration:none;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;background-image:none;background-attachment:initial;background-size:initial;background-origin:initial;background-clip:initial;background-position:initial;background-repeat:initial;" title="2011 Cricket World Cup"&gt;2011 Cricket World Cup&lt;/a&gt;&lt;span style="color:#252525;font-family:sans-serif;font-size:14px;line-height:22.3999996185303px;"&gt;for the opening ceremony. The Stadium had a capacity of close to 55,000 before the work of renovation, making it then the largest stadium of the country . After the renovation, it still remains the largest stadium of the country.&lt;/span&gt;', '2015-05-12', '2015-06-01', '2015-06-02', '0000-00-00', '16:00:00', '18:00:00', 'Bangabandhu National Stadium, Bangabadhu Avenue, Dhaka, Dhaka Division', '23.728173,90.413423', 'Online tickets are not available. You can purchase ticket on the spot @ V.I.P Gate No-2 from Ticketchai.com booth. ', 'active', 1, '2015-05-13 16:46:30', 1, '2015-06-02 06:15:40'),
